(1, 1, '2025-01-17 11:21:04', '2025-01-17 09:21:04', '<!-- wp:paragraph -->\n<p>Tervetuloa WordPressiin. Tämä on ensimmäinen artikkelisi. Muokkaa sitä tai poista se ja aloita kirjoittamaan!</p>\n<!-- /wp:paragraph -->', 'Moikka maailma!', '', 'trash', 'open', 'open', '', 'moikka-maailma__trashed', '', '', '2025-01-17 12:19:48', '2025-01-17 10:19:48', '', 0, 'http://localhost/verkkokauppa/?p=1', 0, 'post', '', 1),
(2, 1, '2025-01-17 11:21:04', '2025-01-17 09:21:04', '<!-- wp:paragraph -->\n<p>Tämä on esimerkkisivu. Se eroaa artikkelista, sillä se pysyy omalla paikallaan ja näkyy sivustosi navigaatiossa (useimmissa teemoissa). Monet tekevät ensimmäisenä Tietoja-sivun, joka esittelee heidät sivuston vierailijoille. Siihen voi kirjoittaa esimerkiksi jotain tämänkaltaista sisältöä:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Tervehdys! Päivätyökseni teen pyörälähetin hommia ja iltaisin toimin harrastelijateatterin parissa. Nämä ovat minun ikiomat sivuni. Asun Paraisilla ja minulla on mahtava koira, jonka nimi on Jaakko. Pidän pi&#241;a colada -drinkeistä ja sateen ropinasta peltikatolla.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...tai jotain tällaista:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hilavitkuttimet Oy perustettiin vuonna 1971 ja se on siitä lähtien tuottanut asiakkailleen laadukkaita hilavitkuttimia. Yli 200 henkilöä työllistävä Hilavitkuttimet Oy sijaitsee Salossa ja järjestää kaikenlaisia tempauksia paikallisen yhteisön iloksi.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Uutena WordPress-käyttäjänä, sinun kannattaa mennä <a href=\"http://localhost/verkkokauppa/wp-admin/\">ohjauspaneeliisi</a> poistaaksesi tämän sivun ja luodaksesi uusia sivuja sisällöllesi. Pidä hauskaa!</p>\n<!-- /wp:paragraph -->', 'Esimerkkisivu', '', 'trash', 'closed', 'open', '', 'esimerkkisivu__trashed', '', '', '2025-01-17 12:24:18', '2025-01-17 10:24:18', '', 0, 'http://localhost/verkkokauppa/?page_id=2', 0, 'page', '', 0),
(3, 1, '2025-01-17 11:21:04', '2025-01-17 09:21:04', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Keitä olemme</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Verkkosivustomme osoite on: http://localhost/verkkokauppa.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Kommentit</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Kun sivuston käyttäjät jättävät kommentteja sivustolle, keräämme kommenttilomakkeessa olevat tiedot, sekä käyttäjän IP-osoitteen ja selaimen versiotiedot roskaviestien tunnistamisen helpottamiseksi.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Kun vierailijat jättävät kommentin tälle sivustolle keräämme tiedon, joka on näkyvissä kommentointikentissä, IP-osoitteen sekä selaimen versioon liittyvät tiedot. Sähköpostiosoitteesta luotu anonymisoitu hajautustieto (hash) voidaan lähettää Gravatar-palveluun, jotta tiedetään onko kommentoija palvelun käyttäjä. Gravatar-palvelun tietosuojaseloste löytyy osoitteesta https://automattic.com/privacy/.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Media</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Mikäli lataat kuvia tälle sivustolle, sinun tulee välttää sellaisten kuvien lataamista, joissa on tallennettu paikkatieto (EXIF GPS). Sivuston vierailijat voivat ladata ja katsoa paikkatietoa kuvista, joita sivustolla on.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Evästeet</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Jos jätät kommentin sivustolle, voit valita nimen, sähköpostiosoitteen ja url-osoitteen tallennuksen evästeeseen. Tämä toiminto lisää käyttömukavuutta, koska lomaketta ei tarvitse täyttää jokaisella kerralla uudelleen kommenttia lisätessä. Evästetieto poistetaan selaimesta vuoden kuluttua.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Mikäli sinulla on tili ja kirjaudut sivustolle, asetamme väliaikaisen evästeen, joka päättelee tukeeko selaimesi evästeitä vai ei. Tämä eväste ei sisällä henkilötietoa ja se poistetaan kun selainikkuna suljetaan.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Kun kirjaudut sisään asetamme useita evästeitä, jotka tallentavat kirjautumis- sekä näyttöasetuksesi. Kirjautumisevästeet poistetaan kahden vuorokauden kuluessa, näyttöasetuksiin liittyvät evästeet poistuvat vuoden päästä. Mikäli valitset “Muista minut” kirjautumisen yhteydessä, kirjautumistietojasi säilytetään kahden viikon ajan. Mikäli kirjaudut ulos, kirjautumiseen liittyvät evästeet poistetaan samassa yhteydessä.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Mikäli julkaiset artikkelin tai muokkaat olemassa olevaa tallennamme selaimeen evästeen, joka sisältää muokattavan artikkelin ID:n. Eväste vanhenee yhdessä vuorokaudessa.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Muilta sivustoilta upotettu sisältö</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Tämän sivuston artikkelit voivat sisältää upotettua sisältöä (esimerkiksi videoita, kuvia, artikkeleita jne.). Toisilta sivustoilta tuodun upotetun sisällön avaaminen on verrattavissa siihen, että vierailija itse kävisi kolmannen osapuolen sivustolla.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Nämä sivustot voivat kerätä tietoa sinusta, käyttää evästeitä, upottaa kolmannen osapuolen seurantaevästeitä ja monitoroida vuorovaikutustasi upotetun sisällön kanssa, mukaan lukien vuorovaikutuksen seuranta jos ja kun olet kirjautunut käyttäjänä sivustolle.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Kenelle jaamme tietosi</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Jos pyydät salasanan palauttamista, IP-osoitteesi liitetään mukaan palautussähköpostiisi.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Kuinka kauan säilytämme tietoa</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Mikäli jätät kommentin, kommenttia ja sen metatietoa säilytetään toistaiseksi. Tämä tehdään siksi, että voimme tunnistaa ja hyväksyä seuraavat kommentit automaattisesti sen sijaan, että säilyttäisimme ne moderointijonossa.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Tallennamme rekisteröityneiden käyttäjien (jos sellaisia on) käyttäjäprofiilien tiedot. Kaikilla käyttäjillä on mahdollisuus nähdä, muokata ja poistaa omia henkilötietojaan milloin vain. Ainoastaan käyttäjänimeä ei voi muuttaa. Verkkosivuston ylläpitäjät voivat nähdä ja muokata käyttäjäprofiilien tietoja.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Mitä oikeuksia sinulla on omaan tietoosi</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Mikäli sinulla on käyttäjätili tälle sivustolle tai olet jättänyt kommentteja, voit pyytää koostetiedostoa omista henkilötiedoistasi, sisältäen kaiken henkilötiedon, jonka olet meille antanut. Voit myös pyytää henkilötietojesi poistoa. Oikeus omien tietojen poistoon ei koske sellaista henkilötietoa, joka meidän on säilytettävä ylläpidollisista, juridisista tai tietoturvaan liittyvistä syistä.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Minne tietosi lähetetään</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Suositeltu teksti: </strong>Vierailijoiden kommentteja saatetaan tarkistaa automatisoidun roskapostiestopalvelun kautta.</p>\n<!-- /wp:paragraph -->\n', 'Tietosuojaseloste', '', 'draft', 'closed', 'open', '', 'tietosuojaseloste', '', '', '2025-01-17 11:21:04', '2025-01-17 09:21:04', '', 0, 'http://localhost/verkkokauppa/?page_id=3', 0, 'page', '', 0),
