(20, 1, '2025-01-17 12:24:18', '2025-01-17 10:24:18', '<!-- wp:paragraph -->\n<p>Tämä on esimerkkisivu. Se eroaa artikkelista, sillä se pysyy omalla paikallaan ja näkyy sivustosi navigaatiossa (useimmissa teemoissa). Monet tekevät ensimmäisenä Tietoja-sivun, joka esittelee heidät sivuston vierailijoille. Siihen voi kirjoittaa esimerkiksi jotain tämänkaltaista sisältöä:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Tervehdys! Päivätyökseni teen pyörälähetin hommia ja iltaisin toimin harrastelijateatterin parissa. Nämä ovat minun ikiomat sivuni. Asun Paraisilla ja minulla on mahtava koira, jonka nimi on Jaakko. Pidän pi&#241;a colada -drinkeistä ja sateen ropinasta peltikatolla.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...tai jotain tällaista:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hilavitkuttimet Oy perustettiin vuonna 1971 ja se on siitä lähtien tuottanut asiakkailleen laadukkaita hilavitkuttimia. Yli 200 henkilöä työllistävä Hilavitkuttimet Oy sijaitsee Salossa ja järjestää kaikenlaisia tempauksia paikallisen yhteisön iloksi.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Uutena WordPress-käyttäjänä, sinun kannattaa mennä <a href=\"http://localhost/verkkokauppa/wp-admin/\">ohjauspaneeliisi</a> poistaaksesi tämän sivun ja luodaksesi uusia sivuja sisällöllesi. Pidä hauskaa!</p>\n<!-- /wp:paragraph -->', 'Esimerkkisivu', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2025-01-17 12:24:18', '2025-01-17 10:24:18', '', 2, 'http://localhost/verkkokauppa/?p=20', 0, 'revision', '', 0),
